import React from 'react';
import './styles/info.css';

const Info = ({data}) => {
	return (
		<div id='weather-info' className="container">
			<p id="info-city">{data.name}</p>
			<p id="info-temp">{data.main?.temp}</p>
			<p id="info-HL">H: {data.main?.temp_max} L: {data.main?.temp_min}</p>
		</div>
	);
}

export default Info;
